	public void setUpPlayer() 
	{ 

		try { 

			Sequencer sequencer = MidiSystem.getSequencer(); 
			sequencer.open();
			// Set to max resolution for correct timing of 135bpm
			Sequence sequence = new Sequence(Sequence.PPQ, 480); 
			Track track = sequence.createTrack();
			
			// Set the instrument to piano
			track.add(makeEvent(192, 1, 1, 0, 1));

			// For each channel add the note
			for (int i = 0; i < inChannels.length; i++) {
				String[] channel = inChannels[i];
				for (int j = 0; j < channel.length; j++) {
					// Parse format
					String command = channel[j];
					int onOff = command.charAt(0) == 'O' ? 144 : 128;
					int tick = Integer.valueOf(command.substring(command.indexOf('|') + 1, command.indexOf('>')));
					int key = Integer.valueOf(command.substring(command.indexOf('>') + 1, command.indexOf(':')));
					int velocity = Integer.valueOf(command.substring(command.indexOf(':') + 1));

					// Add a note on event with specified note 
					track.add(makeEvent(onOff, i + 1, key, velocity, tick));
				}
			}
			
			
			sequencer.setSequence(sequence); 
			sequencer.start(); 

			while (true) { 

				synchronized(sequencer) {
					if (!sequencer.isRunning()) { 
						sequencer.close(); 
						System.exit(1); 
					} 	
					try {
						sequencer.wait(100);
					}
					catch (InterruptedException ex) { 
					}
				}
			} 
		} 
		catch (Exception ex) { 

			ex.printStackTrace(); 
		} 
	} 

	public MidiEvent makeEvent(int command, int channel, 
							int note, int velocity, int tick) 
	{ 

		MidiEvent event = null; 

		try { 

			ShortMessage a = new ShortMessage(); 
			a.setMessage(command, channel, note, velocity); 

			event = new MidiEvent(a, tick); 
		} 
		catch (Exception ex) { 

			ex.printStackTrace(); 
		} 
		return event; 
	} 
